(1, 'I.O.T', 'Kumar , Karthik', 'To connect home appliances using IOT', 'https://www.jigsawacademy.com/jaws/common/iot/images/Connected-Smart-Cities.jpg', 'Arduino , Linux , Sensors...', 'The Internet of Things (IoT) is the inter-networking of physical devices, vehicles (also referred to as "connected devices" and "smart devices"), buildings, and other items embedded with electronics, software, sensors, actuators, and network connectivity which enable these objects to collect and exchange data.[1][2][3] The IoT allows objects to be sensed or controlled remotely across existing network infrastructure,[4] creating opportunities for more direct integration of the physical world into computer-based systems, and resulting in improved efficiency, accuracy and economic benefit in addition to reduced human intervention', 'arduino , GPU , sensors.', 'A new type of software is used', 'Used to increase the effeciency in daily life', 'funding , mentoring.', 'Implementing in several areas', '1000', '20000', 'buut_hgbb@gmail.com', '+91 9757847842'),
(2, 'Tractor', 'Vignesh,Arun', 'Automatic Tractor That does Ploughing things', 'https://i.ytimg.com/vi/F3iIwgJTf2k/maxresdefault.jpg', 'Wheels , Agricultural Land...', 'A tractor is an engineering vehicle specifically designed to deliver a high tractive effort (or torque) at slow speeds, for the purposes of hauling a trailer or machinery used in agriculture or construction. Most commonly, the term is used to describe a farm vehicle that provides the power and traction to mechanize agricultural tasks, especially (and originally) tillage, but nowadays a great variety of tasks. Agricultural implements may be towed behind or mounted on the tractor, and the tractor may also provide a source of power if the implement is mechanised.', 'tractor , wheel ,  engine.', 'highly modernized way of  doing agriculture.', 'used in ploughing , reduces farmers work efficiency.', 'partners, staff guidence', 'Implementing in real time agricultural land.', '10000', '100000', '            uhhbbu@yahoo.com', '+91 4875427549'),
(3, 'Augmented Reality', 'Adarsh , Robert , Raj ', 'Hospital Augmented reality', 'https://www.americaninno.com/wp-content/uploads/wpallimport/files/1/2013/09/dezeen_ikea-launch_augmented-reality_2014_ss2_pan.jpg', 'Google glasses , unity , vuforia .', 'Augmented reality (AR) is a live direct or indirect view of a physical, real-world environment whose elements are "augmented" by computer-generated sensory input such as sound, video, graphics or GPS data. It is related to a more general concept called computer-mediated reality, in which a view of reality is modified (possibly even diminished rather than augmented) by a computer. Augmented reality enhances oneâ€™s current perception of reality, whereas in contrast, virtual reality replaces the real world with a simulated one.[1][2] Augmentation techniques are typically performed in real time and in semantic context with environmental elements, such as overlaying supplemental information like scores over a live video feed of a sporting event', 'video , image recognition', 'uses a new type of algorithm', 'Used for entertainment purposes', 'workplace , mentoring', 'using for educational purpose', '5000', '2000', 'yagtrh_yu@hotmail.com', '+91 245255524'),
(4, 'Artificial Intelligence ', 'Prabhu', 'For checking marks', 'https://futureoflife.org/wp-content/uploads/2015/11/artificial_intelligence_benefits_risk.jpg', 'phython , cloud  devices , machines..', 'Artificial intelligence (AI, also machine intelligence, MI) is intelligence exhibited by machines, rather than humans or other animals (natural intelligence, NI). In computer science, the field of AI research defines itself as the study of "intelligent agents": any device that perceives its environment and takes actions that maximize its chance of success at some goal.[1] Colloquially, the term "artificial intelligence" is applied when a machine mimics "cognitive" functions that humans associate with other human minds, such as "learning" and "problem solving"', 'machine learning , Deep learning', 'uses a new type of machine learning alorithm', 'can be used by students for several study related purposes', 'web hosting , work placee', 'using in realtime websites', '1000', '9000', 'Bakurthr@gmail.com', '+91 01578235'),
(5, 'Fabrics', 'Subash , Prakash , suresh ', 'Fabrics used for advanced textile developments', 'https://3.imimg.com/data3/PK/MQ/MY-2/textile-fabrics-250x250.jpg', 'yarn , machineries..', 'A textile[1] or cloth[2] is a flexible material consisting of a network of natural or artificial fibres (yarn or thread). Yarn is produced by spinning raw fibres of wool, flax, cotton, hemp, or other material to produce long strands.[3] Textiles are formed by weaving, knitting, crocheting, knotting, or felting.\r\n\r\nThe words fabric and cloth are used in textile assembly trades (such as tailoring and dressmaking) as synonyms for textile. ', 'yarn used, textile', 'new methodolgy used', 'in manufacturing new yarns', 'workspace , funding', 'implementing in several areas', '2500', '50000', 'ugvwfg@outlook.com', '+91 18492486'),
(6, 'induction motor', 'Abdul , Gowtham , Dev', 'Used in several commercial purposes', 'https://lh4.googleusercontent.com/-NNwiRRLHjls/TTfjkJIu2yI/AAAAAAAAHkU/qH38J9lhQEA/w581-h569-no/induction%2Bmotor.jpg', 'fan , electricity', 'An induction motor, 3 phase induction motor or asynchronous motor is an AC electric motor in which the electric current in the rotor needed to produce torque is obtained by electromagnetic induction from the magnetic field of the stator winding.[1] An induction motor can therefore be made without electrical connections to the rotor.[a] An induction motor''s rotor can be either wound type or squirrel-cage type.', '', '', '', '', '', '', '', '', ''),
(7, 'Drone', 'Bala', 'Can be used in monitoring', 'https://assets.pcmag.com/media/images/520527-yuneec-typhoon-h.jpg?thumb=y', 'fan , rotatory motors , camera..', 'Drone is a device that consists of a fan a rotatory motor and a camera. It is mainly used to capture motion  and used in surveilance.', '', '', '', '', '', '', '', '', ''),
(8, 'Four Stroke Engine', 'Charlie , Rafiq , Ram , Vimal', 'Used in cars', 'https://i2.wp.com/mechstuff.com/wp-content/uploads/2015/10/4-stroke-engine.jpg', 'engine , lever ,spark plug.....', 'A four-stroke (also four-cycle) engine is an internal combustion (IC) engine in which the piston completes four separate strokes while turning a crankshaft. A stroke refers to the full travel of the piston along the cylinder, in either direction. ', '', '', '', '', '', '', '', '', ''),
(9, 'Medicinal vaccines', 'Rahul , Sankar , Uma', 'For Medicinal puposes', 'https://www.omicsgroup.org/articles-admin/disease-images/adenovirus-vaccination-36498.jpg', 'lab  , test tube , burette ...', 'A vaccine is a biological preparation that provides active acquired immunity to a particular disease. A vaccine typically contains an agent that resembles a disease-causing microorganism and is often made from weakened or killed forms of the microbe, its toxins or one of its surface proteins. The agent stimulates the body''s immune system to recognize the agent as a threat, destroy it, and recognize and destroy any of these microorganisms that it later encounters. Vaccines can be prophylactic (example: to prevent or ameliorate the effects of a future infection by a natural or "wild" pathogen), or therapeutic (e.g., vaccines against cancer are being investigated)', '', '', '', '', '', '', '', '', ''),
(27, 'Nano Technology', 'Balakrishnan', 'making technology smaller', 'https://drive.google.com/uc?id=0B2REszNEKwwGaEg1YmF1RTJSY0E	', 'nano', 'Iti s developed at BIT by BIT TBI', 'Patent filed', 'waterpurification', 'cooporation', 'scaleup', 'implementing in commercial fields', '2000', '100000', 'bittbi@bitsathy.ac,in', '042225578556'),
